import React from "react";
import ReactToPrint from "react-to-print";

const thStyle = {
  fontFamily: "Anton",
  fontWeight: "normal",
  fontStyle: "normal"
};

class ComponentToPrint extends React.Component {

  constructor(props){
    super(props);

    this.state={
      RestpostsAll:[]
    };
  }

  componentDidMount(){
    this.retrieveRestaurant();
  }

  retrieveRestaurant(){
    axios.get("http://localhost:8000/Restaurants").then(res =>{
      if(res.data.success){
        this.setState({
          RestpostsAll:res.data.existingPosts
        });
        console.log(this.state.RestpostsAll)
      }
    });
  }


  render() {
    return (
      <table>
        <thead style={thStyle}>
          <th>column 100</th>
          <th>column 2</th>
          <th>column 3</th>
        </thead>
        <tbody>
          <tr>
            <td>data 1</td>
            <td>data 2</td>
            <td>data 3</td>
          </tr>
          <tr>
            <td>data 1</td>
            <td>data 2</td>
            <td>data 3</td>
          </tr>
          <tr>
            <td>data 1</td>
            <td>data 2</td>
            <td>data 3</td>
          </tr>
        </tbody>
      </table>
    );
  }
}

class Example extends React.Component {
  render() {
    return (
      <div>
        <ReactToPrint
          trigger={() => <button>Print this out!</button>}
          content={() => this.componentRef}
        />
        <ComponentToPrint ref={(el) => (this.componentRef = el)} />
      </div>
    );
  }
}

export default Example;
